def sigmoid(x):
	return(1/(1+np.exp(-x)))

def sigmoidGradient(x):
	return(sigmoid(x)*(1-sigmoid(x)))

def dataimage(img): 
	          
	width, height = img.size
	data = []
	
	imag = img.convert('RGB')

	vec = []
	for x in range(20):
		for y in range(20):
			R,G,B = imag.getpixel((x,y))
			vec.append(1-(R+G+B)/765)

	data.append(vec)

	data = np.array(data)
	return(data)


