def extractList(s,up,down,left,right):
	a = s[up:down]
	k = []
	for i in range(down-up):	
		k.append(5*[0] + a[i][left:right] + 5*[0])

	k = 20*[(right-left+10)*[0]] + k + 20*[(right-left+10)*[0]]


	return(k)

def findletter(picture):
	n = len(picture)
	upper = 0
	for i in range(n):
		if np.sum(np.array(picture[i])) > 1:
			upper = i
			break
	lower = n-1
	for i in range(n):
		if np.sum(np.array(picture[n-i-1])) > 1:
			lower = n-i-1
			break

	return(upper,lower)

def sort(letterlist):
	k = len(letterlist)
	for i in range(k):
		for j in range(k-1):
			if letterlist[j][0] > letterlist[j+1][0]:
				temp = letterlist[j]
				letterlist[j] = letterlist[j+1]
				letterlist[j+1] = temp
	return(letterlist)

def redsquare(data,left,up,right,down):

	data[up][left:right] = (right-left)*[[255,0,0]]
	data[up+1][left:right] = (right-left)*[[255,0,0]]
	data[up-1][left:right] = (right-left)*[[255,0,0]]

	data[down+1][left:right] = (right-left)*[[255,0,0]]
	data[down-1][left:right] = (right-left)*[[255,0,0]]
	data[down][left:right] = (right-left)*[[255,0,0]]
	for x in range(down-up):
		data[up+x][left] = [255,0,0]
		data[up+x][left+1] = [255,0,0]
		data[up+x][left-1] = [255,0,0]

		data[up+x][right+1] = [255,0,0]
		data[up+x][right-1] = [255,0,0]
		data[up+x][right] = [255,0,0]

	return(data)

def bluesquare(data,left,up,right,down):

	data[up][left:right] = (right-left)*[[0,0,255]]
	data[up-1][left:right] = (right-left)*[[0,0,255]]
	data[up-2][left:right] = (right-left)*[[0,0,255]]

	data[down+2][left:right] = (right-left)*[[0,0,255]]
	data[down+1][left:right] = (right-left)*[[0,0,255]]
	data[down][left:right] = (right-left)*[[0,0,255]]
	for x in range(down-up):
		data[up+x][left] = [0,0,255]
		data[up+x][left-1] = [0,0,255]
		data[up+x][left-2] = [0,0,255]

		data[up+x][right+2] = [0,0,255]
		data[up+x][right+1] = [0,0,255]
		data[up+x][right] = [0,0,255]

	return(data)



def lettersplitter(picture):
	
	height = len(picture)
	width = len(picture[0])

	picture = np.array(picture)


	letters = []

	ydataup = []
	ydatadown = []
	for i in range(width):	

		k = picture[:,i]

		average = 0
		for j in range(height):
			if k[j] > 0:
				average = height-j
				break

		ydataup.append(average)

		average = height
		for j in range(height):
			if k[height-j-1] > 0:
				average = j
				break
		
		ydatadown.append(average)


	previous = 0
	for i in range(width-2):
		if np.abs(ydataup[i+1]-ydataup[i]) > 20 and np.abs(ydatadown[i+1]-ydatadown[i]) > 20:
			upper,lower = findletter(picture[:,previous:i])

			if (lower - upper > 10) and (lower-upper < height-1):

				area = (previous,upper,i,lower)
				
				letters.append(area)
			
			previous = i

	return(letters)

