def transformImage():

	area = (np.round((x0-44)*factorX),np.round((y0-15)*factorY),np.round((x3-44)*factorX),np.round((y3-15)*factorY))
	imgoriginal = img_original.crop(area)
	imgoriginal = ImageOps.expand(imgoriginal,border=50,fill='white')

	width, height = imgoriginal.size
	

	data = []
	picture = []

	imag = imgoriginal.convert('RGB')

	for x in range(height):
		vec = []
		row = []
		for y in range(width):
			R,G,B = imag.getpixel((y,x))
			if (1-(R+G+B)/765) > 0.5:
				vec.append([0,0,0])
				row.append(1)
			else:
				vec.append([255,255,255])
				row.append(0)

		data = data + [vec]
		picture = picture + [row]
		
	
	array = np.array(data, dtype=np.uint8)
	global img
	img = Image.fromarray(array)

	img = letterHighlighter(img,picture,data,height,width)


	img = img.resize((int(np.round(width/factorX)),int(np.round(height/factorY))))

	img = ImageTk.PhotoImage(img)

	cv.delete('all')
	cv.create_image(x3, y0, anchor=NE, image=img)


x0,y0,x3,y3 = 0,0,0,0

